import PropTypes from "prop-types";
import React from "react";
import { ButtonsPrimary } from "./ButtonsPrimary";
import { VaskendesignlogoPng } from "./VaskendesignlogoPng";
import "./style.css";

export const Navigation = ({
  property1,
  className,
  vaskendesignlogoPngImage = "image-1-2.png",
  text = "My Work",
  text1 = "Archived Projetcs",
  hasBeforeLogin = true,
}) => {
  return (
    <div className={`navigation ${property1} ${className}`}>
      {["desktop", "tablet"].includes(property1) && (
        <VaskendesignlogoPng
          className="vaskendesignlogo-png-instance"
          image={property1 === "desktop" ? vaskendesignlogoPngImage : "image-1-3.png"}
        />
      )}

      {property1 === "desktop" && (
        <>
          <div className="common-menu">
            <div className="frame">
              <div className="text-wrapper">Home</div>
            </div>
            <div className="frame">
              <div className="text-wrapper">About</div>
            </div>
            <div className="frame">
              <div className="text-wrapper">{text}</div>
            </div>
            <div className="frame">
              <div className="text-wrapper">{text1}</div>
            </div>
          </div>
          <>
            {hasBeforeLogin && (
              <div className="before-login">
                <ButtonsPrimary className="buttons-primary-button-default" text="Start Project" />
              </div>
            )}
          </>
        </>
      )}

      {property1 === "tablet" && <img className="menu" alt="Menu" src="menu.png" />}

      {property1 === "mobile" && (
        <>
          <div className="navigation-desktop">
            <div className="image-wrapper">
              <img className="img" alt="Image" src="image.png" />
            </div>
          </div>
          <img className="menu-2" alt="Menu" src="menu-2.png" />
        </>
      )}
    </div>
  );
};

Navigation.propTypes = {
  property1: PropTypes.oneOf(["desktop", "tablet", "mobile"]),
  vaskendesignlogoPngImage: PropTypes.string,
  text: PropTypes.string,
  text1: PropTypes.string,
  hasBeforeLogin: PropTypes.bool,
};
